window.bookSummaryJSON = "<p>Charlie's life is perfect. She has everything her heart desires. Until it all goes horribly wrong. </p> <p>Charlie and Lincoln return to London to find two supernaturals have been murdered, and Charlie might be next. As if that wasn't bad enough, the man who adopted her has escaped from prison, and the committee members have just learned some news that infuriates them. Now there's talk of sending Charlie away again. Far away. </p> <p>But the worst is yet to come. Charlie is kidnapped and forced to summon one of the murder victims - but she's unable to send him back. With an angry dead supernatural on the loose and the committee determined to get rid of her, Charlie's time with the Ministry of Curiosities, and Lincoln, is in grave danger of coming to an end. </p>"; 
